Alamat}</strong></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">di -</span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Tempat</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n                          <div style=\"magin-left:50px; margin-right:20px\">\r\n<div style=\"margin-left:5%; margin-right:5%; padding:5px 10px\">\r\n<p style=\"margin-left:40px\"><span style=\"font-size:14px\"><em><strong><span style=\"font-family:Times New Roman,Times,serif\"> Assamu\'alaikum Wr. Wb.</span></strong></em></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">         Sehubungan dengan adanya kegiatan Mata Kuliah Kerja Praktek (KP) Fakultas Teknik dan Ilmu Komputer Universitas Sains Al-Qur\'an (UNSIQ) Jawa Tengah di Wonosobo, maka yang bertanda tangan dibawah ini:</span></span></p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-left:10%; width:90%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:100px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Nama</span></span></strong></td>\r\n			<td style=\"width:10px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">:</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">{dosen}</span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Jabatan</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">:</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">{dosen_jabatan}</span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td> </td>\r\n			<td> </td>\r\n			<td><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\"><strong>Universitas Sains Al-Qur\'an(UNSIQ)<br />\r\n			Jawa Tengah di Wonosobo</strong></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">        Dengan ini kami memohon kesediaan Bapak/Ibu untuk memberikan ijin kepada mahasiswa kami untuk meminta data guna keperluan Kerja Praktek (KP) . Adapun mahasiswa tersebut adalah:</span></span></p>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin-left:10%; width:90%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:100px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Nama</span></span></strong></td>\r\n			<td style=\"width:10px\"><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">:</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">{nama_mhs}</span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">NIM</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">:</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">{nim_mhs}</span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Prodi / Smt</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">:</span></span></strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">{prodi_mhs} </span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Semester</span></span></strong></td>\r\n			<td><strong>:</strong></td>\r\n			<td><strong><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">{angkatan_mhs}</span></span></strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Times New Roman,Times,serif\">Dengan surat permohonana ijin diatas ini, atas kerjasamanya kami ucapkan terimakasih.</span></span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-size:14px\"><em><strong><span style=\"font-family:Times New Roman,Times,serif\">Wassalamu\'alaikum Wr. Wb.</span></strong></em></span></p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"s3gt_translate_tooltip_mini\" id=\"s3gt_translate_tooltip_mini_logo\" title=\"Translate selected text\"> </div>\r\n\r\n<div class=\"s3gt_translate_tooltip_mini\" id=\"s3gt_translate_tooltip_mini_sound\" title=\"Play\"> </div>\r\n\r\n<div class=\"s3gt_translate_tooltip_mini\" id=\"s3gt_translate_tooltip_mini_copy\" title=\"Copy text to Clipboard\"> </div>\r\n\r\n<div class=\"s3gt_translate_tooltip_mini_box\" id=\"s3gt_translate_tooltip_mini\" style=\"background:initial !important; border-collapse:initial !important; border-radius:initial !important; border-spacing:initial !important; border:initial !important; box-sizing:initial !important; color:inherit !important; direction:ltr !important; display:initial !important; flex-direction:initial !important; font-family:X-LocaleSpecific,sans-serif,Tahoma,Helvetica !important; font-size:13px !important; font-weight:initial !important; height:initial !important; left:258px; letter-spacing:initial !important; line-height:13px !important; margin-bottom:0px; margi